import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useAuth } from "../../components/context/AuthContextProvider";
import { ADMIN_EMAIL } from "../../helpers/const";

const Navbar = () => {
  const { user, handleLogOut, loading } = useAuth();
  const [isAdmin, setIsAdmin] = useState(false);
  const [openMenu, setOpenMenu] = useState(false); // Состояние для открытия бургера

  useEffect(() => {
    if (user) {
      setIsAdmin(user.email === ADMIN_EMAIL);
    }
  }, [user]);

  const pages = [
    { id: 1, title: "Атлеты", link: "/athletes" },
    { id: 2, title: "Виды спорта", link: "/sports" },
    { id: 3, title: "Медальный зачет", link: "/medal-table" },
  ];

  if (isAdmin) {
    pages.push({ id: 4, title: "Админ", link: "/admin" });
  }

  const handleToggleMenu = () => {
    setOpenMenu(!openMenu);
  };

  return (
    <div style={styles.root}>
      <AppBar position="static" style={styles.appBar}>
        <Toolbar style={styles.toolbar}>
          <div style={styles.leftItems}>
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Flag_of_Kyrgyzstan_%283-2%29.svg/1599px-Flag_of_Kyrgyzstan_%283-2%29.svg.png?20240311163127"
              style={styles.icon}
              alt="Flag"
            />
            <Link to={"/"}>
              <Typography
                variant="h6"
                style={{ textDecoration: "none", color: "#ffffff" }}
              >
                Спортсмены КР
              </Typography>
            </Link>
          </div>
          <div style={{ ...styles.centerItems, flex: 1 }}>
            <IconButton
              edge="start"
              color="inherit"
              aria-label="menu"
              onClick={handleToggleMenu}
              style={styles.menuButton}
            >
              <Typography variant="body1" style={styles.menuItem}>
                ☰
              </Typography>
            </IconButton>
          </div>
          <div style={styles.rightItems}>
            {!loading && (
              <Typography style={{ color: "#ffffff", marginRight: 10 }}>
                {user
                  ? isAdmin
                    ? `Добро пожаловать, ${user.email}`
                    : `Добро пожаловать, ${user.displayName || user.email}`
                  : "Добро пожаловать, гость"}
              </Typography>
            )}
            {!loading && user && (
              <IconButton
                color="inherit"
                onClick={handleLogOut}
                style={styles.menuButton}
              >
                <Typography variant="body1" style={styles.menuItem}>
                  Выйти
                </Typography>
              </IconButton>
            )}
          </div>
        </Toolbar>
      </AppBar>

      {/* Бургер меню */}
      <Drawer anchor="left" open={openMenu} onClose={handleToggleMenu}>
        <List>
          {pages.map((page, index) => (
            <ListItem
              button
              key={page.id}
              component={Link}
              to={page.link}
              onClick={handleToggleMenu}
            >
              <ListItemText primary={page.title} />
            </ListItem>
          ))}
          {!loading && !user && (
            <ListItem
              button
              component={Link}
              to="/register"
              onClick={handleToggleMenu}
            >
              <ListItemText primary="Регистрация" />
            </ListItem>
          )}
        </List>
      </Drawer>
    </div>
  );
};

const styles = {
  root: {
    flexGrow: 1,
    overflow: "hidden",
    width: "100%",
    height: "auto",
  },
  appBar: {
    backgroundColor: "#1a1a1a",
    color: "#ffffff",
    overflow: "hidden",
  },
  toolbar: {
    display: "flex",
    justifyContent: "space-between",
    overflow: "hidden",
  },
  leftItems: {
    display: "flex",
    alignItems: "center",
    overflow: "hidden",
  },
  centerItems: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    overflow: "hidden",
  },
  rightItems: {
    display: "flex",
    alignItems: "center",
    overflow: "hidden",
  },
  menuButton: {
    marginRight: 10,
    overflow: "hidden",
  },
  menuItem: {
    color: "#ffffff",
  },
  icon: {
    width: "auto",
    height: 40,
    marginRight: 10,
    overflow: "hidden",
  },
};

export default Navbar;
